<script type="text/javascript">

 var jArray= <?php echo json_encode($list)?>;
 $('svg').find("g[deviceid]").each(function(index, element1) {
	$(jArray).each(function(index, element2) {
		if($(element1).attr("deviceid")==element2["devid"]){
			if(element2["status"]=="1")
			$(element1).css("fill","#379F15");	
			else
			$(element1).css("fill","#000000");	
       $(element1).attr("status",element2["status"]);}
    });
});
 
function showstatus(element)
{ 
console.log($(element).css("fill","#FF5555"));	
}

function clearstatus(element)
{ 
if($(element).attr("status")=="1")
$(element).css("fill","#379F15");
else	
$(element).css("fill","#000000");
}
	
function showmodal(element){
	
if($(element).attr("status")=="1"){
$(element).attr("status","0");
$(element).css("fill","#000000");
}
else{	
$(element).attr("status","1");
$(element).css("fill","#379F15");
}
$($(element).attr("inkscape:label")).modal('show');
}	
</script> 